import Design from "./components/Design";
import svg from './designes/test_svg.svg'
import './index.css'
import { useState } from "react"
import DesTable from "./components/DesTable";

function App() {
  const [designes, setDesignes] = useState([
    {
      id: 1,
      image_path: svg,
      design_path: svg,
      title: 'test icon',
      author: 'interweb',
      expanded: true,
    },
    {
      id: 2,
      image_path: svg,
      design_path: svg,
      title: 'test icon2',
      author: 'interweb2',
      expanded: false,
    },
    {
      id: 3,
      image_path: svg,
      design_path: svg,
      title: 'test icon3',
      author: 'interweb3',
      expanded: false,
    },
    {
      id: 4,
      image_path: svg,
      design_path: svg,
      title: 'test icon4',
      author: 'interweb4',
      expanded: false,
    }
  ])

  function expandDesign (id){
    if (!designes.some(designe => designe.expanded === false))
    {
      setDesignes(designes.map((designe) => (
        designe.id==id?
        {...designe, expanded: true} : designe
      )))
    }
  }

  return (
    <div className='container'>
      <div >
        <img src={svg} className='header'/>
        <p className='explaination'> la;ldskj fasdjflsdkfj ;laf ldhfkl jadhflasdjhfkajsdh </p>
      </div>


      <DesTable designes={designes} onClick={expandDesign}/>
      {/* <Design image_path={designes[0].image_path} design_path={designes[0].design_path} author={designes[0].author} title={designes[0].title}/> */}
    </div>
  );
}
const title = {
  color:'red',
  backgroundColor:"blue",
}
export default App;
